def print_int(name, x):
    print(f"int {name} = {x};")


def print_matrix(matrix, last=False):
    for x in matrix:
        a = x
        for i in range(8):
            if last and x is matrix[-1] and i == 7:
                print(f"0x{format(a&0xFF, '02x')}")
            else:
                print(f"0x{format(a&0xFF, '02x')}, ")
            a >>= 8


